eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\n// Module\nvar code = \"<hr>\\n<p>title: 우아한테크코스 레벨 4 절반 회고\\nsubTitle: 한 발 늦게 하는 절반 회고\\ndate: 2022-10-16</p>\\n<hr>\\n<h2 id=\\\"프로젝트-잘-되고-있나\\\">프로젝트, 잘 되고 있나?</h2>\\n<p>레벨 3을 마지막으로 본격적인 협업을 끝내고 다시금 개인별 미션이 시작됐다.\\n하나씩 취업을 준비하는 크루들도 생겼고 이력서니, 코딩 테스트니 하는 말들도 빈번하게 들려왔다.\\n당연하지만 우리 팀도 그러한 기류를 피해가지는 못했다.\\n개인별 미션이 따로 진행되는만큼,\\n이러한 사정들을 고려해 어느정도 각자의 시간을 필요하다는 공감대가 형성되었고 이로 인해 협업 패턴에도 변화가 생겼다.\\n간단히 요약하면 본인의 미션을 우선으로 하고 남는 시간에 프로젝트를 하기로 했는데,\\n지금 시점에서 돌아보기론 결과적으로 잘못된 선택이 아니었나 싶다.</p>\\n<p>딱 한 줄로 요약하면 개발 속도도 지지부진하고, 결과물도 만족스럽게 나오지 않았다.\\n레벨 3이 끝났다고, 개인별 미션이 생겼다고 팀 데모데이가 끝난 것은 아니었기에 우리는 끊임없이 회의하고 개발해야했고\\n처음에 계획했던 찬란한 구현 목표들은 계속해서 생겨나는 미션과 개인 사정들에 묻혀 끝내 빛을 보지 못하고 사라져버렸다.</p>\\n<p><img src=\\\"https://user-images.githubusercontent.com/28296575/196041713-55282f48-7d7b-4c7e-8d26-71091442f4ee.png\\\" alt=\\\"90%는 시도도 하지 못한 추가 기능들\\\"></p>\\n<p>또 터져나온 버그를 고치며 생각했다. 어디서부터 잘못된 것이었을까.</p>\\n<h2 id=\\\"코치님의-조언\\\">코치님의 조언</h2>\\n<blockquote>\\n<p>지금 할 수 있는 것들에 집중해라.</p>\\n</blockquote>\\n<p><strong>&quot;지금 여러분 옆에 있는 사람들과 같이 프로젝트를 경험 할 수 있는 기회는 많지 않아요.&quot;</strong></p>\\n<p><strong>&quot;지금 할 수 있는 것들에 집중하세요.&quot;</strong></p>\\n<p>어떤 크루의 &quot;앞으로 취업 준비는 어떻게 하는게 좋을까요?&quot; 라는 질문에 대한 답변이었다.\\n언뜻 보면 당연한 말이지만, 그 당연한 말을 지키지 못하고 있는 지금의 내 모습과 겹쳐보였다.\\n취업 준비를 위한다는 명목으로 스터디도 하고, 개인 공부를 하겠다며 공식 문서를 긁어 블로그를 쓰고...</p>\\n<p>나는 정말로 그 지식들이 필요해서 했던걸까?\\n그저 가만히 있긴 불안해서, 글 하나라도 더 쓰면 취업에 도움이 되겠지 하는 어줍잖은 생각으로 다른 것들에 집착했던건 아니었을까?</p>\\n<p>물론 아무것도 안하고 있는 것 보다야 도움이 되겠지만, 이미 내 주위에는 훨씬 더 가치있는 것들이 있었던걸 보지 못했다.\\n당장 레벨 3 기간동안 찐한 협업을 온몸으로 느끼며 진행한 이 프로젝트가 그랬다.</p>\\n<p>결과물이야 만족스럽든 그렇지 않든, 살면서 한 번도 해본 적 없던 큰 규모의 개발을 하며 많은 어려움을 느꼈고 그만큼 큰 시간을 투자했다.\\n알게 모르게 나와 내 페어의 생각, 코딩에 대한 가치관, 협업 과정, 거기에서 온 다양한 경험들이 녹아들어 있었고\\n조금만 살펴보면 씹고 뜯고 맛보고 즐길거리로 가득한 보물창고나 다름없는 상태였던 것이다.</p>\\n<p>그동안 스스로에게 만족하지 못했던 경험들에 가려 진짜 가치를 알아보지 못했을 뿐이지, 이만한 자산은 어딜가도 찾을 수 없었다.</p>\\n<h2 id=\\\"내-프로젝트를-사랑하자\\\">내 프로젝트를 사랑하자</h2>\\n<p>내가 만든 서비스를 내가 사랑하지 않으면 누가 사랑해줄까. 내 서비스의 첫 이용자는 그 누구도 아닌 바로 나다.\\n그동안 애써 겉으로 표현하지 않았던 불만족스러운 부분들에서 눈을 돌리지 않기로 했다.\\n얼마의 시간이 더 걸릴지, 이걸 하면서 또 얼마나 괴로울지 같은 생각은 깔끔하게 접었다.\\n자식같은 서비스인데 그런게 다 무슨 소용이 있을까. 그래서 나는 내 프로젝트를 사랑하기로 했다.</p>\\n<p>보기 싫은 버그들이 계속 튀어나오던 생성 페이지도, 모바일에선 검색어 하나 치기 힘든 메인 페이지도 다 버렸다.\\n처음부터 다시 시작하는 마음으로 피그마 시안을 짜기 시작했다. 슬프지만 괜찮다. 넘어지면 무엇인가를 주워서 일어나면 된다고 누군가 말했으니.\\n모바일 화면을 제대로 지원하지 못하는 기존의 디자인에서 벗어나 처음부터 반응형을 염두해두고 디자인했다.</p>\\n<p>이 과정들을 혼자 했다면 정말 힘들고, 지금 시점에서도 끝이 안보이는 상황이었을지도 모르겠다.\\n하지만 든든한 모모 팀원들이 있어서 함께 으쌰으쌰 할 수 있었다.\\n이건 그냥 하는 말이 아니라, 정말 백 프론트 할 것 없이 피그마 디자인부터 같이 진행했다.</p>\\n<p><img src=\\\"https://user-images.githubusercontent.com/28296575/196041280-7bc2507e-4f43-4ca6-a0a8-a09b40dd6071.png\\\" alt=\\\"팀원들과 함께 진행한 천하제일시안대회\\\"></p>\\n<p>그저 아이디어를 좀 내고 피드백을 해주는 수준이 아니라, 정말로 인당 하나씩 각 페이지의 시안을 만들었고\\n백엔드 크루였던 렉스와 유콩의 아이디어가 상당수 반영되었다. (이 친구들 진짜 잘한다!)\\n특히나 디자인을 하는 내내 &quot;피그마 재밌다!&quot; 를 외치며 열정적인 모습을 보였던 렉스를 보며 살짝 눈물이 날 정도였다.</p>\\n<p>그렇게 모두의 힘을 합쳐 산처럼 쌓여있던 문제들도 지금은 거의 해결해내고, 지금은 생성 페이지 마무리 작업을 하고 있다.\\n우리 멋진 팀원들이 없었다면 제시간에는 절대 끝내지 못했을거다.</p>\\n<h2 id=\\\"그러면-해피-엔딩\\\">그러면 해피 엔딩?</h2>\\n<p><strong>그렇게 프로젝트를 잘 끝내고 모모 팀원들은 오래오래 행복하게 잘 살았답니다.</strong></p>\\n<p>에서 끝나면 당연히 안된다.\\n우리가 무엇때문에 이렇게 괴로워했고, 다음엔 어떻게 해야할지 반성하고 회고하는 과정을 거쳐야한다.</p>\\n<p>첫 번째 원인은 <strong>경험 부족</strong>이었다.\\n이전에 이정도의 프로젝트를 진행해본적이 없으니 일정 산출부터 시작해 모든 부분에서 예상과 달랐던 점이 드러났고\\n이는 그대로 스노우볼이 되어 팀 전체에 굴러 내려왔다. 분명 처음엔 &quot;이 정도면 되겠지~&quot; 라며 여유를 부렸던 것 같은데,\\n항상 스프린트든 레벨이든 끝날때가 다가오면 그 동안의 업보를 돌려받았다.\\n업보의 눈덩이는 계획된 기능을 다 구현하지 못하거나, 예상에 없던 야근을 하는 형태로 귀신 같이 찾아왔다.</p>\\n<p>두 번째 원인은 첫 번째 원인에서 비롯된 것일수도 있는데, <strong>도메인 자체가 너무 복잡했다는 점</strong>이다.\\n여러 개의 날짜와 시간, 유저 개별 정보들이 합쳐지기 시작하며 우리가 고려해야 할 것들은 말도 안되는 수준으로 불어났다.\\n뭐 하나를 추가하려 하면 일거리가 제곱으로 늘어나는 느낌이라고 해야할까.\\n중학교때 배웠던 지수 함수의 그래프와 비슷한 형태라고 생각한다.</p>\\n<p><img src=\\\"https://upload.wikimedia.org/wikipedia/commons/thumb/c/c6/Exp.svg/200px-Exp.svg.png\\\" alt=\\\"미칠듯이 늘어난다\\\"></p>\\n<p>물론 처음에도 쉽다고는 생각하지 않았는데, 생각보다 훨씬 더 어렵고 문제가 많이 생겨서 지금도 버그와 싸우고 있긴 하다.\\n이건 어떻게 피할 수 있을까. 다음부턴 이런 도메인 하지 말기? 😂</p>\\n<h2 id=\\\"마무리\\\">마무리</h2>\\n<p>우여곡절이 많았지만 그래도 이번 레벨. 어떻게든 잘 이겨낸 것 같다.\\n항상 최선의 선택을 했다고는 못하겠지만, 아주 나쁘지만은 또 않은게 끝날때가 다가온다고 고생한걸 잊은걸까? 모르겠다.</p>\\n<p>레벨 4가 정말로 끝날때쯤에 한 번 더 회고를 쓸텐데 그때도 지금과 같은 생각과 마음일지가 궁금해진다. 개인적으론 그랬으면 좋겠는데.</p>\\n<p>이상 회고 끝 😊</p>\\n\";\n// Exports\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = (code);//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(rsc)/./src/posts/3.md\n");

